export default function About() {
    return(
        <div className="about">
            <p1>
                This senior capstone project is a meal tracking web application designed to help users log their meals, monitor their nutrition, and maintain healthy eating habits. Built from the ground up using React for the frontend, Node.js for the backend, and SQLite for data storage, this project highlights a full-stack development approach with a focus on user-friendly design and functionality.
            </p1>
            <br/>
            <br/>
            <p1>
                I am a senior at the University of Redlands, pursuing a BS in Computer Science, with a passion for frontend development and creating intuitive user experiences. Through this project, I am applying my skills in React, Node.js, and database management, while continuously learning and refining my expertise in full-stack development.
            </p1>
        </div>
    );
}
